import { useEffect, useState } from "react";
import styled from "styled-components";
import { getMyLecture } from "./api";

// 강의정보
const Found = styled.div`
  width: 100%;
  height: 50px;
  display: flex;
  justify-content: right;
  background-color: #00d1fe;
  padding-right: 56px;
`;
const FoundSearch = styled.div`
  display: flex;
  justify-content: center;
  input {
    width: 250px;
    margin-right: 30px;
    height: 30px;
    border-radius: 4px;
    border: none;
    font-size: 15px;
    padding: 0 20px;
    margin-top: 10px;
    margin-bottom: 10px;
  }
  button {
    transition: 0.3s;
    width: 100px;
    height: 30px;
    border-radius: 4px;
    background-color: #fff;
    border: none;
    font-size: 15px;
    color: #00d1fe;
    font-weight: bold;
    margin-top: 10px;
    border-radius: 30px;
    &:hover {
      opacity: 0.6;
    }
  }
`;
const User = styled.div`
  width: 100%;
  height: auto;
  display: flex;
`;
const UserInfo = styled.div`
  display: flex;
  align-items: flex-start;
  width: 25%;
  border-right: 1px solid #999;
  position: relative;
  ul {
    width: fit-content;
    height: auto;
    list-style: none;
    margin: 38% 10%;
  }
  li {
    width: 250px;
    height: 50px;
    line-height: 50px;
    font-size: 18px;
  }
  li:first-child {
    font-weight: bold;
    font-size: 25px;
    margin-bottom: 50px;
  }
  a {
    text-decoration: none;
    color: #000;
    &:hover {
      color: #00d1fe;
    }
  }
`;
const Myclass = styled.li``;
const UserEdit = styled.li``;
const UserData = styled.div`
  width: 100%;
  overflow: hidden;
`;
const Mylecture = styled.div`
  width: 100%;
  height: 100%;
  float: left;
  h2 {
    width: auto;
    height: auto;
    margin: 30px 0 30px 30px;
    border-bottom: 3px solid #00d1fe;
    padding: 15px;
  }
`;
const LectureWrap = styled.div`
  width: 100%;
  height: 40%;
  display: flex;
  justify-content: center;
  flex-direction: column;
  align-self: center;
  overflow: scroll;
  overflow-x: hidden;
`;
const LectureBox = styled.div``;
const BestLecture = styled.div``;
const BestLectureList = styled.ul``;
const Picture = styled.p``;
const SubText = styled.span``;
// 유저정보수정
const UserModify = styled.div``;
const Write = styled.div`
  height: auto;
  margin-top: 120px;
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: center;
`;
const Password = styled.input``;
const PasswordCheck = styled.input``;
const EmailWrap = styled.div``;
const Email = styled.input``;
const EmailCheck = styled.button``;
const Name = styled.input``;
const Gender = styled.div``;
const Btnwrap = styled.div``;

export function Mypage() {
  const [userData, setUserData] = useState(null);
  const [data, setData] = useState(null);

  useEffect(() => {
    const response = getNowUser();
