    const response = getMyLecture(id);
    const Mylecture = response.data;
    console.log(Mylecture);

    setData(Mylecture);
  }, []);

  return (
    <>
      <Found>
        <FoundSearch>
          <input type="search" id="found" placeholder="검색" />
          <button>검색</button>
        </FoundSearch>
      </Found>

      <User>
        <UserInfo>
          <ul href="#">
            <li>최건</li>
            <Myclass>
              <a href="#">내 강의 보기</a>
            </Myclass>
            <UserEdit>
              <a href="#">회원정보 수정</a>
            </UserEdit>
            <UserEdit>
              <a href="dashboard.html">대시보드 바로가기</a>
            </UserEdit>
          </ul>
