                <li>
                  <a href="#">
                    <Picture>강동원 사진</Picture>
                    <SubText> </SubText>
                  </a>
                </li>
                <li>
                  <a href="#">
                    <Picture>업 사진</Picture>
                    <SubText> </SubText>
                  </a>
                </li>
                <li>
                  <a href="#">
                    <Picture>쇼생크 탈출</Picture>
                    <SubText> </SubText>
                  </a>
                </li>
              </BestLectureList>
            </BestLecture>
